import React from 'react';

export default function TopBar() {
    return (
        <div style={{
            fontSize: '2em'
        }}>
            <div style={{
                fontSize: '1.2em'
            }}>Title</div>
            <div>
                <MenuItem>Phonology</MenuItem>
            </div>
        </div>
    );
}

function MenuItem({label}) {
    return (
        <>
            <div>{label}</div>
        </>
    )
}
